import{f as e,h as t,j as n,t as r}from"./chunks/plugin-vue_export-helper.Dz-VHcSB.js";const i=JSON.parse(`{"title":"Art","description":"","frontmatter":{},"headers":[],"relativePath":"Non-Sorted/Art.md","filePath":"Non-Sorted/Art.md","lastUpdated":1756574703000}`);var a={name:`Non-Sorted/Art.md`};function o(r,i,a,o,s,c){return n(),e(`div`,null,[...i[0]||=[t(`<h1 id="art" tabindex="-1">Art <a class="header-anchor" href="#art" aria-label="Permalink to “Art”">​</a></h1><p>Art is a diverse range of human activities in creating visual, auditory or performing artifacts (artworks), expressing the author&#39;s imaginative, conceptual ideas, or technical skill, intended to be appreciated for their beauty or emotional power</p><h2 id="painting" tabindex="-1">Painting <a class="header-anchor" href="#painting" aria-label="Permalink to “Painting”">​</a></h2><p>Painting is the practice of applying paint, pigment, colour or other medium to a solid surface (called the &quot;matrix&quot; or &quot;support&quot;). The medium is commonly applied to the base with a brush, but other implements, such as knives, sponges, and airbrushes, can be used</p><p>Timeline:</p><ul><li>The Age of Enlightenment (17th - 18th century)</li></ul><p>Techniques:</p><ul><li>Subtractive Painting: Removing paint</li><li>Ruckenfigur: Painting from behind</li><li>Chiaroscuro: Light and shadow</li><li>Sfumato: Blurring of outlines</li><li>Tenebrism: Dramatic use of light and shadow</li><li>Impasto: Thick application of paint</li><li>Glazing: Thin layers of paint</li><li>Scumbling: Broken color</li></ul><p>Painters:</p><ol><li><p>Caspar David Friedrich (1774 - 1840)</p><ul><li>Landscape painting</li><li>Wintry</li><li>The sublime</li><li>Ruckenfigur</li><li>German, Romanticism</li><li>&quot;The Monk By The Sea&quot; - 1808 - 1810</li><li>&quot;Chalk Cliffs On Rugen&quot; - 1818</li><li>&quot;Wanderer Above The Sea Of Fog&quot; - 1818</li><li>&quot;Moonrise Over The Sea&quot; - 1822</li><li>&quot;The Sea Of Ice&quot; - 1823</li></ul></li><li><p>Asher Brown Durand (1796 - 1886)</p><ul><li>American</li><li>Hudson River School</li><li>&quot;Pastoral Landscape&quot; - 1861</li><li>&quot;Kindred Spirits&quot; - 1849</li><li>&quot;Progress&quot; - 1853</li><li>&quot;The First Harvest In The Wilderness&quot; - 1855</li><li>&quot;The Catskills&quot; - 1859</li></ul></li><li><p>Thomas Cole (1801 - 1848)</p><ul><li>American</li><li>Hudson River School</li><li>&quot;The Titan&#39;s Goblet&quot; - 1833</li><li>&quot;The Course Of Empire&quot; - 1833 - 1836</li><li>&quot;The Oxbow&quot; - 1836</li><li>&quot;The Voyage Of Life&quot; - 1842</li><li>&quot;The Arcadian Or Pastoral State&quot; - 1836</li></ul></li><li><p>Claude Lorrain (1600 - 1682)</p><ul><li>French</li><li>Baroque</li><li>Landscape painting</li><li>&quot;Seaport At Sunset&quot; - 1639</li><li>&quot;The Roman Campagna&quot; - 1639</li><li>&quot;Pastoral Landscape&quot; - 1646</li></ul></li><li><p>Giorgio De Chirico (1888 - 1978)</p><ul><li>Italian</li><li>Metaphysical Art Movement</li><li>Metaphysical Town Squares - Series</li><li>&quot;The Enigma Of An Autumn Afternoon&quot; - 1910</li><li>&quot;The Song Of Love&quot; - 1914</li><li>&quot;The Disquieting Muses&quot; - 1916</li></ul></li><li><p>Philipp Otto Runge (1777 - 1810)</p><ul><li>German</li><li>Romanticism</li><li>&quot;The Nightingale&#39;s Lesson&quot; - 1804-05</li><li>&quot;Morning&quot; - 1808</li><li>&quot;Evening&quot; - 1808</li><li>&quot;Midday&quot; - 1808</li><li>&quot;The Hulsenbeck Children&quot; - 1805</li></ul></li><li><p>Johannes Vermeer (1632 - 1675)</p><ul><li>Dutch</li><li>Dutch Golden Age</li><li>Baroque</li><li>&quot;The Little Street&quot; - 1657 - 1658</li><li>&quot;The Milkmaid&quot; - 1658</li><li>&quot;Girl With A Pearl Earring&quot; - 1665</li><li>&quot;The Music Lesson&quot; - 1662 - 1665</li><li>&quot;The Art Of Painting&quot; - 1666</li><li>&quot;The Geographer&quot; - 1668</li><li>&quot;The Astronomer&quot; - 1668</li></ul></li></ol><h2 id="photography" tabindex="-1">Photography <a class="header-anchor" href="#photography" aria-label="Permalink to “Photography”">​</a></h2><p>Photography is the art, application, and practice of creating durable images by recording light, either electronically by means of an image sensor, or chemically by means of a light-sensitive material such as photographic film</p><p>Inventions:</p><ul><li>Joseph Nicéphore Niépce (1765 - 1833): First photograph</li><li>Louis Daguerre (1787 - 1851): Daguerreotype</li><li>William Henry Fox Talbot (1800 - 1877): Calotype</li><li>James Clerk Maxwell (1831 - 1879): First colour photograph</li><li>Thomas Sutton (1819 - 1875): First colour photograph</li></ul><p>Photographers:</p><ol><li><p>Kimbei Kusakabe (1841 - 1934)</p><ul><li>Japanese</li><li>&quot;Country children&quot; - 1890</li></ul></li><li><p>Helen Messinger Murdoch (1862 - 1956)</p><ul><li>American</li><li>&quot;Taj Mahal&quot; - 1921</li></ul></li><li><p>Louis Arthur Ducos du Hauron (1837 - 1920)</p><ul><li>French</li><li>&quot;View of Agen, France&quot; - 1877</li><li>&quot;Still life with dahlias&quot; - 1869</li></ul></li></ol><h2 id="royal-society" tabindex="-1">Royal Society <a class="header-anchor" href="#royal-society" aria-label="Permalink to “Royal Society”">​</a></h2><blockquote><p>It is an expression of the determination of Fellows to withstand the domination of authority and to <strong>verify all statements</strong> by an appeal to <strong>facts</strong> determined by <strong>experiment</strong></p></blockquote>`,18)]])}var s=r(a,[[`render`,o]]);export{i as __pageData,s as default};